CREATE PROCEDURE seckill\.execute_seckill\(IN v_seckill_id BIGINT\,
 IN v_phone BIGINT\, IN v_kill_time TIMESTAMP\, OUT r_result INT\)
 BEGIN
 DECLARE insert_count INT DEFAULT 0\;
 START TRANSACTION\;
 INSERT IGNORE success_killed\(seckill_id\, user_phone\, create_time\)
 VALUES \(v_seckill_id\, v_phone\, v_kill_time\)\;
 /\* 返回上条操作影响的行数\，\<0时表示sql错误/未执行 \*/
 SELECT ROW_COUNT\(\) INTO insert_count\;
 IF insert_count \<\= 0 THEN
 /\* 插入冲突\，回滚 \*/ 
 ROLLBACK\;
 IF insert_count \= 0 THEN
 /\*标明原因\-1\：重复秒杀 \*/
 SET r_result \= \-1\;
 ELSE
 /\*标明原因\-2\：系统异常 \*/
 SET r_result \= \-2\;
 END IF\;
 END IF\;
 END //
